function removeInformal(){
	$( "#show-informal" ).trigger( "click" );
	setTimeout(function(){ openMore() }, 250 );
}

function openMore(){
	var moreButton = $("div.refine-by.venue >  ul.more-options");
	if( $(moreButton).is( ":visible" ) ){
		$(moreButton).find( "li > button" ).trigger( "click" );
		setTimeout(function(){ openMore() }, 250 );
	} else {
		rankConferencesGRIN();
		rankJournalsSCIMAGO();
	}
}

function rankConferencesGRIN(){
	const venues = $(".inproceedings .title + a span[itemprop='isPartOf'] > span[itemprop='name']");
	$( venues ).each( function( i, venueItem ){
		_rankConferenceGRIN( venueItem );
	});
}

function _rankConferenceGRIN( venueItem ){
    const venueName = $( venueItem ).closest("a").text().replace(/\d+/g,"").replace(/PACMPL\s*\d*\((\w+)\)/, "$1").replace(/\(.+\)/g, "").trim();
    console.log( "GRIN: " + venueName );
    const year = parseInt( $( venueItem ).parent().parent().parent().find( "span[itemprop='datePublished']" ).text() );
    var rankingYear = "2018";
    if ( year < 2016 ){
        rankingYear = "2015";
    } else if( year < 2018 ){
        rankingYear = "2017";
    }
    const venueEntry = new Fuse( window.GRIN_RANKING[ rankingYear ], { "keys" : ["t"], "threshold" : 0.3 } ).search( venueName )[0] ;
    if ( venueEntry != undefined ){
        $( venueItem ).parents( ".data" ).append( "<div style=\"background-color:#f1f1f1\">" + venueEntry.t + ", rankings: <strong>" + venueEntry.r + "</strong></div>" );
    }
}

function rankJournalsSCIMAGO(){
	const journals = $(".article .title + a span[itemprop='isPartOf'] > span[itemprop='name']");
	$( journals ).each( function( i, journal ){
        console.log( $( journal ).text() + ": " + $( journal ).text().includes( "PACMPL" ) );
        if( $( journal ).text().includes( "PACMPL" ) ){
            _rankConferenceGRIN( journal );
        } else {
            _rankJournalSCIMAGO( journal );
        }
	});
}

function _rankJournalSCIMAGO( journal ){
const journalLink = $( journal ).parent().parent().attr( "href" );
		GM_xmlhttpRequest({
			method: "GET",
			url: journalLink,
			onload: function( response ) {
				const ownerDocument = document.implementation.createHTMLDocument('virtual');
				const journalItem = $( response.responseText, ownerDocument).find( "#breadcrumbs > ul > li > span:nth-child(3) > a > span" ).text().trim();
				const year = $( journal ).parent().parent().parent().find( "span[itemprop='datePublished']" ).text();
				const URI = "https://www.scimagojr.com/journalsearch.php?q=" + encodeURIComponent( journalItem ).replace(/%20/g,"+");
				GM_xmlhttpRequest({
					method: "GET",
					url: URI,
					onload: function( response ) {
						var linkToJournalPage = $( response.responseText, ownerDocument ).find( "div.search_results > a" );
						const URI = "https://www.scimagojr.com/" + $( linkToJournalPage ).attr( "href" );
						if( linkToJournalPage != undefined ){
							GM_xmlhttpRequest({
								method: "GET",
								url: URI,
								onload: function( response ) {
									const title = $( response.responseText, ownerDocument ).find( "h1" ).text().trim();
									var quartiles = response.responseText.match( /var dataquartiles = "(.+)"/ );
									if( quartiles != null && quartiles.length > 0 ){
										quartiles = quartiles[1].replace( /;/g, "," );
										const q = csvJSON( quartiles );
										var rank = "";
										$.each( q, function(i, v) {
											if ( v.Year == year ) {
												if( rank.length > 0 ){ rank += ", "; }
												rank += v.Category.replace(/\(.+\)/g,"") + " : " + v.Quartile;
											}
										});
                                        if( rank.length == 0 ){
                                            if( rank.length > 0 ){ rank += ", "; }
                                            rank += q[ q.length - 1 ].Category.replace(/\(.+\)/g,"") + " : " + q[ q.length - 1 ].Quartile;
                                        }
										$( journal ).parents( ".data" ).append( "<div style=\"background-color:#f1f1f1\"><a href=\"" + URI + "\">" + title + "</a>, rankings: <strong>" + rank + "</strong></div>" );
									}
								}
							});
						}
					}
				});
			}
		});
}

function csvJSON( csv ){
	const lines=csv.split("\\n");
	const result = [];
	const headers=lines[0].split(",");
	for( var i=1; i<lines.length; i++ ){
		var obj = {};
		var currentline=lines[i].split(",");
		for( var j=0; j<headers.length; j++ ){
			obj[ headers[j] ] = currentline[j];
		}
		result.push( obj );
	}
	return result;
}

